We could find the full build command that Studio runs by doing the following:

1. Open Preferences > Studio > Troubleshooting page;
2. Change Debug Level to All and make "com.aptana.debug/debug/shell" entry checked;
3. Hit OK and run the project;
4. Open Help > Studio > View Log File;
5. Scroll to the bottom and find the line that contains "titanium.CMD ... build".

Vatthanachai, could you try the above steps? Once you locate the line, paste the command to command prompt (without the "Process: " part) and run it to see if it generates the same error.

Thanks.
